import la1 from '../../img/la1.jpg';
export default function LifeAria() {
    return (
        <div>
            <h1 className="top-hedng">AREA OF LIFE</h1>
            <h5 className="top-sub-hedng">
            SOLUTIONS TO FIT YOUR TIME, YOUR LIFESTYLE AND YOUR BUDGET
            </h5>
        </div>
    )
}
